function Sizes() {
  const width = window.innerWidth;
  const height = window.innerHeight;

  return {
    width,
    height,
    aspect: width / height,
    pixelRatio: Math.min(window.devicePixelRatio, 2),
    frustrum: 4.5
  };
}

