function setUpScene() {
  renderer = new THREE.WebGLRenderer({
    antialias: true,
    alpha: true
  });
  const sizes = Sizes();
  renderer.outputColorSpace = THREE.SRGBColorSpace;
  renderer.toneMapping = THREE.CineonToneMapping;
  renderer.toneMappingExposure = 1.75;
  renderer.shadowMap.enabled = true;
  renderer.shadowMap.type = THREE.PCFSoftShadowMap;

  renderer.setPixelRatio(sizes.pixelRatio);
  renderer.setSize(sizes.width, sizes.height);
  canvas = renderer.domElement;
  document.body.appendChild(canvas);

  scene = new THREE.Scene();

  // Listen for window resize
  window.addEventListener('resize', () => {
    // Update sizes
    const sizes = Sizes();
    renderer.setPixelRatio(sizes.pixelRatio);
    renderer.setSize(sizes.width, sizes.height);

    // Update camera aspect ratio if needed
    if (camera) {
      camera.aspect = sizes.width / sizes.height;
      camera.updateProjectionMatrix();
    }
  });
}

function setUpOrbitControls() {
  orbitControls = new OrbitControls(camera, canvas);
  orbitControls.enableDamping = true;
  orbitControls.enableZoom = true;
  orbitControls.enablePan = true;
  orbitControls.target.set(0, 0, 0);

  // var controls = new ObjectControls(perspectiveCamera, canvas, rubiksCube);
}

function addLights() {
  // Sun Light
  sunLight = new THREE.DirectionalLight(
    parameters.sunlight.color,
    parameters.sunlight.intensity
  );
  sunLight.castShadow = true;
  sunLight.shadow.camera.far = 20;
  sunLight.shadow.mapSize.set(1024, 1024);
  sunLight.shadow.normalBias = 0.05;

  sunLight.position.set(
    parameters.sunlight.position.x,
    parameters.sunlight.position.y,
    parameters.sunlight.position.z
  );
  scene.add(sunLight);

  pointLight = new THREE.PointLight(
    parameters.pointLight.color,
    parameters.pointLight.intensity,
    100,
    0.1
  );

  pointLight.position.set(
    parameters.pointLight.position.x,
    parameters.pointLight.position.y,
    parameters.pointLight.position.z
  );
  pointLight.scale.set(20, 20, 20);
  // pointLight.y = 0;
  scene.add(pointLight);
  pointLight.lookAt(0, 0, 0);
  if (parameters.pointLight.showHelper) {
    const pointLightHelper = new THREE.PointLightHelper(pointLight, 1);
    scene.add(pointLightHelper);
  }
}

function watchPointer() {
  window.addEventListener("pointermove", (e) => {
    pointer.x = (e.clientX / window.innerWidth) * 2 - 1;
    pointer.y = -(e.clientY / window.innerHeight) * 2 + 1;
  });
}

