function generateRocksMaterial() {
  rockMaterial = new THREE.MeshStandardMaterial({
    color: "#fff",
    roughnessMap: rockTexture.rocksRoughness,
    map: rockTexture.rocksDiffuse,
    normalMap: rockTexture.rocksNormals
  });
}

function generateRocks() {
  loader.parse(
    rockGLTF,
    "/",
    function (gltf) {
      // gltf.scale.multiplyScalar(0.1);
      const children = gltf.scene.children[0];
      // children.scale.multiplyScalar(0.0001);
      rockGeometry = children.geometry;
      // gltf.scene.children[0].scale.multiplyScalar(0.1);
      // rockGeometry.scale.multiplyScalar(0.1);

      rockGeometry.computeVertexNormals();

      // rockGeometry.scale(0.1, 0.1, 0.1);
      // rockGeometry.scale(0.001, 0.001, 0.001);

      generateRocksMaterial();
      // generateRockMeshes();
      // addRockInstancesToScreen();
      // rotateMeshes();
      generateRockMeshesAndAddToScreen();

      camera.position.x = 208;
      camera.position.y = 180;
      camera.position.z = 477;
      camera.lookAt(rocksGroup.position);
    },
    function (error) {
      console.log(error);
    }
  );
}

function generateRockMeshes() {
  rockMeshInstances = new THREE.InstancedMesh(
    rockGeometry,
    rockMaterial,
    parameters.amountOfRocks
  );

  rockMeshInstances.receiveShadow = true;
  rockMeshInstances.castShadow = true;
  rockMeshInstances.position.set(0, 0, 0);
}

function addRockInstancesToScreen() {
  const center = new THREE.Vector3(0, 0, 0); // Set the center of the circle

  for (let i = 0; i < parameters.amountOfRocks; i++) {
    const angle = (i / parameters.amountOfRocks) * Math.PI * 2; // Calculate the angle for each mesh
    const x = center.x + parameters.radius * Math.cos(angle); // Calculate x position
    const y = center.y; // Set y position to the same level (you can modify if needed)
    const z = center.z + parameters.radius * Math.sin(angle); // Calculate z position

    // dummy.scale.set(0.001, 0.001, 0.001);

    dummy.position.set(x, y, z - 1);
    dummy.updateMatrix();

    rockMeshInstances.setMatrixAt(i, dummy.matrix);
    rockMeshInstances.instanceMatrix.needsUpdate = true;
    rockMeshInstances.computeBoundingSphere();
  }
  rockMeshInstances.instanceMatrix.needsUpdate = true;
  rockMeshInstances.computeBoundingSphere();
  scene.add(rockMeshInstances);
}

function generateRockMeshesAndAddToScreen(params) {
  const center = new THREE.Vector3(0, 0, 0); // Set the center of the circle

  for (let i = 0; i < parameters.amountOfRocks; i++) {
    const angle = (i / parameters.amountOfRocks) * Math.PI * 2; // Calculate the angle for each mesh
    const x = center.x + parameters.radius * Math.cos(angle); // Calculate x position
    const y = center.y; // Set y position to the same level (you can modify if needed)
    const z = center.z + parameters.radius * Math.sin(angle); // Calculate z position
    const randomRotation = new THREE.Euler(
      Math.PI * Math.random() * 2,
      Math.PI * Math.random() * 1,
      Math.PI * Math.random() * 0.5
    );
    const rockMeshInstance = new THREE.Mesh(rockGeometry, rockMaterial);
    rockMeshInstance.rotation.copy(randomRotation);
    rockMeshInstance.receiveShadow = true;
    rockMeshInstance.castShadow = true;
    rockMeshInstance.position.set(x, y, z - 1);

    rocksGroup.add(rockMeshInstance);
  }
  scene.add(rocksGroup);
}

function setUpCamera() {
  const sizes = Sizes();
  camera = new THREE.PerspectiveCamera(40, sizes.aspect, 1, 1000);

  scene.add(camera);
}

