function animateRocks() {
  rocksGroup.children.forEach((mesh) => {
    mesh.rotation.x += parameters.rotationSpeed;
    mesh.rotation.y += parameters.rotationSpeed;
    mesh.rotation.z += parameters.rotationSpeed;
  });
}

function rotateMeshes() {
  if (!rockMeshInstances)
    throw "Please call the generateRockMeshes method before calling this method";
  const matrix = new THREE.Matrix4();
  const rotateDummy = new THREE.Object3D();
  for (let index = 0; index < parameters.amountOfRocks; index++) {
    rockMeshInstances.getMatrixAt(index, matrix);
    matrix.decompose(
      rotateDummy.position,
      rotateDummy.rotation,
      rotateDummy.scale
    );
    const randomRotation = new THREE.Euler(
      Math.PI * Math.random() * 2,
      Math.PI * Math.random() * 1,
      Math.PI * Math.random() * 0.5
    );
    rotateDummy.rotation.copy(randomRotation);
    rotateDummy.updateMatrix();
    rockMeshInstances.setMatrixAt(index, rotateDummy.matrix);
  }
  rockMeshInstances.instanceMatrix.needsUpdate = true;
  rockMeshInstances.computeBoundingSphere();
}

function positionPointLight() {
  raycaster.setFromCamera(pointer, camera);

  const vector = new THREE.Vector3(pointer.x, pointer.y, 0.5);
  vector.unproject(camera);
  const dir = vector.sub(camera.position).normalize();
  const distance = -camera.position.z / dir.z;
  const pos = camera.position.clone().add(dir.multiplyScalar(distance));
  pointLight.position.setX(pos.x);
  pointLight.position.setY(pos.y);
  // pointLight.position.setY(pos.z);
}
var axis = new THREE.Vector3(0, 0, 0).normalize();
var speed = 0.01;

function renderScene(time) {
  animateRocks();
  positionPointLight();
  if (rocksGroup) {
    rocksGroup.rotation.y += parameters.rotationSpeed * 2;
  }
  renderer.render(scene, camera);
}

function launchAnimationLoop() {
  renderer.setAnimationLoop(renderScene);
}

